import { Root } from "../../constants"

export const fetchs = async ({ url, body = {}, method = 'POST' }) => {
  const fetchResponse = await fetch(`${Root.baseurl}${url}`, {
    method: method,
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(body),
  }).catch(error => console.log(error))
  return await fetchResponse.json()
}

export const GetCardType = (number) => {
  var re = new RegExp("^4")
  if (number.match(re) != null)
    return { title: "Visa", image: { uri: 'data:image/png;base64,' } }
  if (/^(5[1-5][0-9]{14}|2(22[1-9][0-9]{12}|2[3-9][0-9]{13}|[3-6][0-9]{14}|7[0-1][0-9]{13}|720[0-9]{12}))$/.test(number))
    return { title: "Mastercard", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^3[47]")
  if (number.match(re) != null)
    return { title: "AMEX", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^(6011|622(12[6-9]|1[3-9][0-9]|[2-8][0-9]{2}|9[0-1][0-9]|92[0-5]|64[4-9])|65)")
  if (number.match(re) != null)
    return { title: "Discover", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^36")
  if (number.match(re) != null)
    return { title: "Diners", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^30[0-5]")
  if (number.match(re) != null)
    return { title: "Diners - Carte Blanche", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^35(2[89]|[3-8][0-9])")
  if (number.match(re) != null)
    return { title: "JCB", image: { uri: 'data:image/png;base64,' } }
  re = new RegExp("^(4026|417500|4508|4844|491(3|7))")
  if (number.match(re) != null)
    return { title: "Visa Electron", image: { uri: 'data:image/png;base64,' } }
  return { title: "Visa", image: { uri: 'data:image/png;base64,' } }
}